 care, and health and wellness categories.<\\/p><p>\\u00a0<\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"c274263\",\"elType\":\"section\",\"settings\":{\"structure\":\"20\"},\"elements\":[{\"id\":\"bf4fd6c\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"3516656\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Derived from the Sanskrit word \\u2018Nayaka\\u2019 meaning actress or one in the spotlight, Nykaa is all about celebrating the star in each woman, and being her confidante and companion as she embarks on her own journey to discover her unique identity and personal style. From the widest selection of genuine beauty products from around the world to beauty advice, Nykaa is truly passionate about catering to your every beauty and wellness need. Because after all, Your Beauty is Our Passion.<\\/p>\",\"column_gap\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]},\"align\":\"left\",\"typography_typography\":\"custom\",\"typography_font_family\":\"Roboto\",\"typography_font_size\":{\"unit\":\"px\",\"size\":19,\"sizes\":[]},\"typography_font_weight\":\"400\",\"typography_line_height\":{\"unit\":\"px\",\"size\":29,\"sizes\":[]},\"typography_letter_spacing\":{\"unit\":\"px\",\"size\":0,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false},{\"id\":\"f69dbc2\",\"elType\":\"column\",\"settings\":{\"_column_size\":50,\"_inline_size\":null},\"elements\":[{\"id\":\"675621c\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/wordpress_assignment2\\/wordpress\\/wp-content\\/uploads\\/2023\\/03\\/nykaa.jpeg\",\"id\":40,\"size\":\"\",\"alt\":\"\",\"source\":\"library\"},\"width\":{\"unit\":\"%\",\"size\":100,\"sizes\":[]},\"space\":{\"unit\":\"%\",\"size\":100,\"sizes\":[]},\"opacity\":{\"unit\":\"px\",\"size\":1,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false