(304, 36, '_elementor_data', '[{\"id\":\"7c4c757\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"ad0f417\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"dc1468a\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><strong>The Nykaa Story <\\/strong><\\/p>\\n<p><strong>India\\u2019s largest omnichannel beauty destination <\\/strong><\\/p>\\n<p>Since our launch, we have not only redefined the art of e-retailing beauty and personal care in India, but also have been instrumental in fostering the growth of a previously relatively nascent ecosystem. From bringing you domestic brands, international brands, luxury and prestige brands, premium brands, niche and cult brands and expert advice and videos, coupled with our understanding of the needs and preferences of the consumers,<\\/p>\\n<p>\\u00a0<\\/p>\",\"align\":\"center\",\"text_color\":\"#1C1B1B\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"6c3e5c7\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"de4072d\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"7eb91fe\",\"elType\":\"widget\",\"settings\":{\"image\":{\"url\":\"http:\\/\\/localhost\\/wordpress_assignment2\\/wordpress\\/wp-content\\/uploads\\/2023\\/03\\/nykaa.jpeg\",\"id\":40,\"size\":\"\",\"alt\":\"\",\"source\":\"library\"},\"width\":{\"unit\":\"%\",\"size\":100,\"sizes\":[]},\"space\":{\"unit\":\"%\",\"size\":100,\"sizes\":[]},\"opacity\":{\"unit\":\"px\",\"size\":1,\"sizes\":[]}},\"elements\":[],\"widgetType\":\"image\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"a4a042f\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"7c4c0ff\",\"elType\":\"column\",\"settings\":{\"_column_size\":100,\"_inline_size\":null},\"elements\":[{\"id\":\"52bcbbe\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p>Ten years after being founded by entrepreneur Falguni Nayar with the goal of inspiring Indian women, Nykaa has evolved into one of India\\u2019s largest cosmetics and lifestyle brands. Nearly 10 million people shop there, and a November IPO raised $700 million at a $13 billion valuation\\u2014turning Nayar, the CEO, into India\\u2019s richest self-made businesswoman. Expansion and marketing led to a 23% drop in net profits in the nine months to December, but revenue grew 65% year-over-year to $376 million.<\\/p>\",\"align\":\"center\",\"text_color\":\"#1C1B1B\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
