 Falguni Nayar with the goal of inspiring Indian women, Nykaa has evolved into one of India\\u2019s largest cosmetics and lifestyle brands. Nearly 10 million people shop there, and a November IPO raised $700 million at a $13 billion valuation\\u2014turning Nayar, the CEO, into India\\u2019s richest self-made businesswoman. Expansion and marketing led to a 23% drop in net profits in the nine months to December, but revenue grew 65% year-over-year to $376 million.<\\/p>\",\"align\":\"center\",\"text_color\":\"#1C1B1B\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
