(33, 1, '2023-03-24 06:10:35', '2023-03-24 06:10:35', '<style>/*! elementor - v3.11.5 - 14-03-2023 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"808\" height=\"632\" src=\"http://localhost/wordpress_assignment2/wordpress/wp-content/uploads/2023/03/banner.jpeg\" alt=\"\" loading=\"lazy\" />															\n		<p>Since our launch, we have not only redefined the art of e-retailing beauty and personal care in India, but also have been instrumental in fostering the growth of a previously relatively nascent ecosystem. From bringing you domestic brands, international brands, luxury and prestige brands, premium brands, niche and cult brands and expert advice and videos, coupled with our understanding of the needs and preferences of the consumers,to more than 72 Luxe and On-Trend and Kiosk Stores, an ever growing online community for beauty buffs, and a Beauty Helpline, we go out of our way to give you only the very best. With 2400+, 100% authentic brands Nykaa offers a well curated comprehensive selection of makeup, skincare, haircare, bath and body, fragrance, grooming appliances, personal care, and health and wellness categories.</p><p></p><p>Derived from the Sanskrit word Nayaka meaning actress or one in the spotlight, Nykaa is all about celebrating the star in each woman, and being her confidante and companion as she embarks on her own journey to discover her unique identity and personal style. From the widest selection of genuine beauty products from around the world to beauty advice, Nykaa is truly passionate about catering to your every beauty and wellness need. Because after all, Your Beauty is Our Passion.</p>		\n															<img width=\"318\" height=\"159\" src=\"http://localhost/wordpress_assignment2/wordpress/wp-content/uploads/2023/03/nykaa.jpeg\" alt=\"\" loading=\"lazy\" />', 'Home', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2023-03-27 12:00:20', '2023-03-27 12:00:20', '', 0, 'http://localhost/wordpress_assignment2/wordpress/?page_id=33', 0, 'page', '', 0),
