(36, 1, '2023-03-24 06:11:04', '2023-03-24 06:11:04', '<p><strong>The Nykaa Story </strong></p>\n<p><strong>Indias largest omnichannel beauty destination </strong></p>\n<p>Since our launch, we have not only redefined the art of e-retailing beauty and personal care in India, but also have been instrumental in fostering the growth of a previously relatively nascent ecosystem. From bringing you domestic brands, international brands, luxury and prestige brands, premium brands, niche and cult brands and expert advice and videos, coupled with our understanding of the needs and preferences of the consumers,</p>\n<p></p>		\n			<style>/*! elementor - v3.11.5 - 14-03-2023 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"318\" height=\"159\" src=\"http://localhost/wordpress_assignment2/wordpress/wp-content/uploads/2023/03/nykaa.jpeg\" alt=\"\" loading=\"lazy\" />															\n		<p>Ten years after being founded by entrepreneur Falguni Nayar with the goal of inspiring Indian women, Nykaa has evolved into one of Indias largest cosmetics and lifestyle brands. Nearly 10 million people shop there, and a November IPO raised $700 million at a $13 billion valuationturning Nayar, the CEO, into Indias richest self-made businesswoman. Expansion and marketing led to a 23% drop in net profits in the nine months to December, but revenue grew 65% year-over-year to $376 million.</p>', 'About Us', '', 'publish', 'closed', 'closed', '', 'about-us', '', '', '2023-03-27 12:07:30', '2023-03-27 12:07:30', '', 0, 'http://localhost/wordpress_assignment2/wordpress/?page_id=36', 0, 'page', '', 0),
