(47, 1, '2023-03-24 06:22:13', '2023-03-24 06:22:13', '<!-- wp:heading {\"textAlign\":\"center\",\"level\":1} -->\n<h1 class=\"has-text-align-center\"><strong>The Nykaa Story</strong></h1>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\"><strong>Indias largest omnichannel beauty destination</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Since our launch, we have not only redefined the art of e-retailing beauty and personal care in India, but also have been instrumental in fostering the growth of a previously relatively nascent ecosystem. From bringing you domestic brands, international brands, luxury and prestige brands, premium brands, niche and cult brands and expert advice and videos, coupled with our understanding of the needs and preferences of the consumers,to more than 72 Luxe and On-Trend and Kiosk Stores, an ever growing online community for beauty buffs, and a Beauty Helpline, we go out of our way to give you only the very best. With 2400+, 100% authentic brands Nykaa offers a well curated comprehensive selection of makeup, skincare, haircare, bath and body, fragrance, grooming appliances, personal care, and health and wellness categories.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Derived from the Sanskrit word Nayaka meaning actress or one in the spotlight, Nykaa is all about celebrating the star in each woman, and being her confidante and companion as she embarks on her own journey to discover her unique identity and personal style. From the widest selection of genuine beauty products from around the world to beauty advice, Nykaa is truly passionate about catering to your every beauty and wellness need. Because after all, Your Beauty is Our Passion.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":40,\"width\":820,\"height\":410,\"sizeSlug\":\"full\",\"linkDestination\":\"none\"} -->\n<figure class=\"wp-block-image size-full is-resized\"><img src=\"http://localhost/wordpress_assignment2/wordpress/wp-content/uploads/2023/03/nykaa.jpeg\" alt=\"\" class=\"wp-image-40\" width=\"820\" height=\"410\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Ten years after being founded by entrepreneur<a rel=\"noreferrer noopener\" href=\"https://www.cnn.com/2021/11/12/business/nykaa-falguni-nayar-india-billionaire-hnk-intl/index.html\" target=\"_blank\">Falguni Nayar</a>with the goal of inspiring Indian women, Nykaa has evolved into one of Indias largest cosmetics and lifestyle brands. Nearly 10 million people shop there, and a November IPO raised $700 million at a $13 billion valuationturning Nayar, the CEO, into Indias richest self-made businesswoman. Expansion and marketing led to a 23% drop in net profits in the nine months to December, but revenue grew 65% year-over-year to $376 million.</p>\n<!-- /wp:paragraph -->', 'About Us', '', 'inherit', 'closed', 'closed', '', '36-revision-v1', '', '', '2023-03-24 06:22:13', '2023-03-24 06:22:13', '', 36, 'http://localhost/wordpress_assignment2/wordpress/?p=47', 0, 'revision', '', 0),
