(64, 1, '2023-03-27 05:37:32', '2023-03-27 05:37:32', '<!-- wp:columns -->\n<!-- /wp:columns -->		\n			<style>/*! elementor - v3.11.5 - 14-03-2023 */\n.elementor-widget-image{text-align:center}.elementor-widget-image a{display:inline-block}.elementor-widget-image a img[src$=\".svg\"]{width:48px}.elementor-widget-image img{vertical-align:middle;display:inline-block}</style>												<img width=\"300\" height=\"168\" src=\"http://localhost/wordpress_assignment2/wordpress/wp-content/uploads/2023/03/c2.jpeg\" alt=\"\" loading=\"lazy\" />															\n		[contact-form-7 id=\"50\" title=\"Contact form 1\"]<p>Thank you for contacting Nykaa and sharing your feedback with us. We appreciate your willingness to communicate with us and value your opinion.</p>\n<p>At Nykaa, we are committed to providing our customers with the best possible experience, and your feedback helps us to achieve that goal. We are constantly working to improve our products and services to meet the needs of our customers.</p>\n<p>Your feedback is important to us, and we will take it into consideration as we continue to grow and evolve as a company</p>', 'Contact Us', '', 'publish', 'closed', 'closed', '', 'contact-us', '', '', '2023-03-27 12:21:40', '2023-03-27 12:21:40', '', 0, 'http://localhost/wordpress_assignment2/wordpress/?page_id=64', 0, 'page', '', 0),
